import "./App.css";
import React from "react";
import Header from "./Header";
import Home from "./Home";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

function App() {
  return (
    <div className="App">
      <Router>
        <Routes>
          <Route path="/checkout" element={<Header />} />

          <Route path="/">
            <Header />
            <Home />
          </Route>
        </Routes>
      </Router>
    </div>
  );
}

export default App;
